  @override
  String get privacyBlock7 =>
      'Важећи закон о заштити података даје вам свеобухватна права као субјекту података (право на информације и интервенцију) у односу на контролора у вези са обрадом ваших личних података, о чему ћемо вас обавестити у наставку:\n\n- Право на информисање сходно чл. 15 ГДПР: Конкретно, имате право да добијете информације о вашим личним подацима које обрађујемо, сврси обраде, категоријама личних података који се обрађују, примаоцима или категоријама прималаца којима су ваши подаци откривени или ће бити откривени, планираном периоду складиштења или критеријумима за одређивање периода складиштења, постојању права на исправку, брисање, приговору, приговору на обраду, ограничењу ауторске обраде, ограничавању порекла обраде. ваше податке ако их ми нисмо прикупили од вас, постојање аутоматизованог доношења одлука, укључујући профилисање, и, где је применљиво, смислене информације о укљученој логици и значају и предвиђеним последицама такве обраде за вас, као и ваше право да будете обавештени о гаранцијама које постоје у складу са чл. 46 ГДПР када се ваши подаци преносе у треће земље;\n\n- Право на исправку у складу са чл. 16 ГДПР: Имате право да без одлагања исправите нетачне податке који се тичу вас и/или да допуните непотпуне податке које чувамо.\n\n- Право на брисање сходно чл. 17 ГДПР: Имате право да захтевате брисање ваших личних података ако су испуњени услови из чл. 17(1) ГДПР су испуњени. Међутим, ово право се не примењује посебно ако је обрада неопходна за остваривање права на слободу изражавања и информисања, за поштовање законске обавезе, из разлога јавног интереса или за успостављање, остваривање или одбрану правних захтева.\n\n- Право на ограничење обраде сходно чл. 18 ГДПР: Имате право да затражите ограничење обраде ваших личних података све док се проверава тачност ваших података ако сте уложили приговор на брисање ваших података на основу недозвољене обраде података и уместо тога затражити ограничење обраде ваших података ако су вам подаци потребни за тврдњу, остваривање или одбрану правних захтева за које више нисмо имали потребе за прикупљањем података или након што више нисмо имали потребе за прикупљањем података. уложили приговор на основу разлога који се односе на вашу конкретну ситуацију, све док још није јасно да ли преовладавају наши легитимни разлози;\n\n- Право на информисање сходно чл. 19 ГДПР: Ако сте искористили своје право на исправку, брисање или ограничење обраде у односу на контролора, контролор је дужан да обавести све примаоце којима су откривени ваши лични подаци о овом исправљању или брисању података или ограничењу обраде, осим ако се то покаже немогућим или укључује несразмеран напор. Имате право да будете обавештени о овим примаоцима.\n\n- Право на преносивост података у складу са чл. 20 ГДПР: Имате право да примите своје личне податке које сте нам дали у структурираном, уобичајено коришћеном и машински читљивом формату или да затражите њихов пренос другом контролору, када је то технички изводљиво.\n\n- Право на повлачење сагласности дате у складу са чл. 7(3) ГДПР: Имате право да повучете своју сагласност за обраду података у било ком тренутку са ефектом за будућност. У случају повлачења, без одлагања ћемо избрисати дотичне податке, осим ако се даља обрада не може заснивати на правном основу за обраду без сагласности. Повлачење сагласности не утиче на законитост обраде на основу сагласности пре њеног повлачења.\n\n- Право на подношење жалбе у складу са чл. 77 ГДПР: Ако сматрате да обрада ваших личних података крши ГДПР, имате право да поднесете жалбу надзорном органу, посебно у држави чланици вашег пребивалишта, вашем радном месту или месту наводног кршења, не доводећи у питање било који други административни или судски лек.';

